si pone come il più avanzato del segmento oltre che il più veloce, non solo del segmento ma anche di categorie di prodotto ben superiori.\n\nUn'auto studiata nel minimo dettaglio per essere dunque al top del segmento C-SUV premium, con soluzioni interessanti in tema di stile ed interni assolutamente all'altezza con motori che forse peccano per ampiezza di gamma ma sono assolutamente presenti nel cuore del mercato con due 1.5 turbo ibridi a benzina da 130 e 160 CV che si affiancano nella proposta ad un 1.6 da 130 CV turbodiesel. Un motore quest'ultimo \"da flotta\" e che tra i privati dovrebbe lasciare il passo a quella soluzione ibrida che ha molto di italiano nel concetto con cui è sviluppata: sì perché il nuovo motore \"160\", che condivide la base tecnica con il \"130\" già visto su Compass, è stato pensato attorno ad un turbo a geometria variabile, che rappresenta quasi una unicità nel panorama dei motori a benzina, ma soprattutto utilizza un modulo ibrido dotato di una batteria leggerissima e di un motore elettrico che trova posto nel cuore del cambio per offrire tutto quello che una vettura full-hybrid fa al \"prezzo\" di peso e di complicazione tenica/economica di una mild-hybrid. Questo è stato reso possibile dalla stretta collaborazione con il partner tecnico Magna che, tra l'altro, fornisce lo stesso sistema anche a BMW con una logica di lavoro ben diversa: a Monaco, infatti, hanno deciso di non utilizzare l'elettrico per manovrare o muovere la vettura a motore spento sfruttandone il potenziale solamente in movimento per completare la spinta del termico. Cosa che ovviamente fa anche Tonale, anche nella variante \"130\".\n\nPiù avanti arriverà anche la plug-in hybrid da 275 CV, con il motore posteriore elettrico da 90 kW ed una batteria da 15,5 kWh in grado di assicurare 80 km in elettrico. Ma di quella declinazione di prodotto, che sfrutterà il potenziale termico di un 1.3 turbo da 180 CV, ne parleremo dopo l'estate. \n\nOggi ci concentriamo sulla Tonale Hybrid 160 CV, che è lunga 453 cm, poggia su un passo di 264 ed offre un bagagliaio da 500 litri, che diventano 1.550 abbattendo gli schienali. Tecnologia full-led per i fari anteriori e posteriori, sistemi di aiuto alla guida di livello 2, strumentazione digitale, cambio automatico per tutte le declinazioni di motore, la Tonale arriverà in concessionaria ad un prezzo a partire da 35.500 euro.\n\nDa guidare la vettura non sconvolge per la potenza del motore ma il fatto che spesso si viaggi in elettrico da una percezione di grande modernità. Anche il lavoro di assetto sulla piattaforma small-wide è stato notevole e l'introduzione delle sospensioni McPherson anche al posteriore ci ha convinto. L'unico dettaglio che stona è una certa rigidità delle sospensioni su buche e cambi d'asfalto ed una velocità di sterzo sin troppo marcata nella prima fase di sterzata, oltre la quale la vettura dimostra grande coerenza. Quello che ci si aspetta da una grande Alfa Romeo...\n\nProva su strada test drive by Emiliano Perucca Orfei Masterpilot"
