        "description": "Konflikti mes vjehrrës, kunatës dhe nuses së djalit ka   degraduar  në dhunë fizike brenda familjes Çepani. Ishte Kristina dhe Petriti të cilët rrëfyen në studion e emisionit me “Zemer të Hapur” se  ndiheshin të kërcënuar nga familjarët, kryesisht nga vjehrra dhe kunata e Kristinës. Mes të tjerash ata treguan se qëndrimi në shtëpi  në të njëjtin ambient të përbashkët ka degraduar në dhunë fizike, nga ana tjetër Kristina pretendon se vjehrra e ka dhunuar dhe se nuk e duan praninë e saj në banesë. Të njëjtën gjë pohoi edhe Petriti për motrën e tij dhe nënën, ku ndër të tjera ai u shpreh se bashkëshortja e tij dhe vajza ndihen të rrezikuar në banesë. Por i menjëhershëm ka qenë reagimi i kunatës, e cila  kundërshtoi deklaratën e çiftit duke i akuzuar ata për probleme  dhe nusen e vëllait e akuzoi për dhunë ndaj vjehrrës. Konflikt ky i cili ka çuar në urdhëra mbrojtje ndaj palëve. Ditën e sotme do të përballen në studio vjehrra, nusja dhe kunata. Ndiqni emisionin…",
